@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:CashCard a owl:Class .
atm:Password a owl:Class .
atm:Account a owl:Class .
atm:BankComputer a owl:Class .
atm:ATM a owl:Class .
atm:AccountOk a owl:Class .

atm:hasCashCard a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:CashCard .

atm:hasPassword a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Password .

atm:hasAccount a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Account .

atm:sendsMessage a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:ATM .

atm:AccountOk a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:sendsMessage ;
        owl:someValuesFrom atm:ATM
    ] .

[
    a owl:Class ;
    owl:intersectionOf (
        atm:BankComputer
        [
            a owl:Restriction ;
            owl:onProperty atm:hasCashCard ;
            owl:someValuesFrom atm:CashCard
        ]
        [
            a owl:Restriction ;
            owl:onProperty atm:hasPassword ;
            owl:someValuesFrom atm:Password
        ]
        [
            a owl:Restriction ;
            owl:onProperty atm:hasAccount ;
            owl:someValuesFrom atm:Account
        ]
    )
] rdfs:subClassOf atm:AccountOk .
